import {Paper, styled} from "@mui/material"

// from material ui website 
const Item = styled(Paper)(({ theme }) => ({
    ...theme.typography.body2,
    padding: theme.spacing(1),
    textAlign: 'center',
    color: theme.palette.text.primary,
    width: "40%",
    marginTop: "2rem",
    elevation: "3",
    borderColor:"red"
    }));

export default Item;
